import React from 'react';

function TimelineSlots({ events, selectedDate, onSlotClick }) {
  // Generate hours for the timeline (showing 12-hour format like in your image)
  const hours = Array.from({ length: 24 }, (_, i) => i);
  
  const formatHour = (hour) => {
    if (hour === 0) return '12 AM';
    if (hour < 12) return `${hour} AM`;
    if (hour === 12) return '12 PM';
    return `${hour - 12} PM`;
  };

  const getEventsForHour = (hour) => {
    return events.filter(event => {
      const eventHour = parseInt(event.time.split(':')[0]);
      return eventHour === hour;
    });
  };

  // Color scheme for different time periods
  const getSlotColors = (hour, hasEvents) => {
    if (hasEvents) {
      // Vibrant colors for booked slots based on time of day
      if (hour >= 6 && hour < 9) return { bg: '#ff6b6b', border: '#e63946' }; // Early Morning - Red
      if (hour >= 9 && hour < 12) return { bg: '#4ecdc4', border: '#26c6da' }; // Late Morning - Teal
      if (hour >= 12 && hour < 15) return { bg: '#45b7d1', border: '#2196f3' }; // Early Afternoon - Blue
      if (hour >= 15 && hour < 18) return { bg: '#96ceb4', border: '#4caf50' }; // Late Afternoon - Green
      if (hour >= 18 && hour < 21) return { bg: '#feca57', border: '#ff9800' }; // Evening - Orange
      return { bg: '#a29bfe', border: '#6c5ce7' }; // Night - Purple
    } else {
      // Soft gradient colors for available slots
      if (hour >= 6 && hour < 9) return { bg: 'linear-gradient(135deg, #ffe0e0, #fff0f0)', border: '#ffcccb' };
      if (hour >= 9 && hour < 12) return { bg: 'linear-gradient(135deg, #e0f7f6, #f0ffff)', border: '#b2dfdb' };
      if (hour >= 12 && hour < 15) return { bg: 'linear-gradient(135deg, #e6f3ff, #f0f8ff)', border: '#bbdefb' };
      if (hour >= 15 && hour < 18) return { bg: 'linear-gradient(135deg, #e8f5e8, #f0fff0)', border: '#c8e6c9' };
      if (hour >= 18 && hour < 21) return { bg: 'linear-gradient(135deg, #fff4e6, #fffaf0)', border: '#ffe0b2' };
      return { bg: 'linear-gradient(135deg, #f0f0ff, #f8f8ff)', border: '#e1bee7' };
    }
  };

  // Focus on daytime hours (like your image shows 1 PM - 6 PM range)
  const displayHours = hours.slice(6, 22); // 6 AM to 10 PM

  return (
    <div style={{ 
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      borderRadius: '12px',
      padding: '30px',
      boxShadow: '0 8px 32px rgba(0,0,0,0.1)',
      overflow: 'hidden',
      color: 'white'
    }}>
      <h3 style={{ 
        marginBottom: '30px', 
        textAlign: 'center',
        fontSize: '28px',
        color: 'white',
        textShadow: '0 2px 4px rgba(0,0,0,0.3)',
        fontWeight: '300'
      }}>
        {selectedDate.toLocaleDateString('en-US', {
          weekday: 'long',
          month: 'long',
          day: 'numeric',
          year: 'numeric'
        })}
      </h3>
      
      {/* Timeline Container */}
      <div style={{ 
        overflowX: 'auto',
        paddingBottom: '20px'
      }}>
        {/* Hour Labels */}
        <div style={{ 
          display: 'flex',
          marginBottom: '20px',
          minWidth: '800px'
        }}>
          {displayHours.map(hour => (
            <div
              key={`label-${hour}`}
              style={{
                flex: 1,
                textAlign: 'center',
                fontSize: '16px',
                fontWeight: 'bold',
                color: 'white',
                minWidth: '80px',
                padding: '0 5px',
                textShadow: '0 1px 2px rgba(0,0,0,0.3)'
              }}
            >
              {formatHour(hour)}
            </div>
          ))}
        </div>

        {/* Timeline Bar with tick marks */}
        <div style={{
          position: 'relative',
          height: '80px',
          background: '#f8f9fa',
          border: '2px solid #dee2e6',
          borderRadius: '8px',
          minWidth: '800px',
          display: 'flex',
          boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)'
        }}>
          {/* Tick marks */}
          {displayHours.map(hour => {
            const hourEvents = getEventsForHour(hour);
            const hasEvents = hourEvents.length > 0;
            
            return (
              <div
                key={`slot-${hour}`}
                onClick={() => onSlotClick && onSlotClick(hour)}
                style={{
                  flex: 1,
                  height: '100%',
                  borderRight: hour < displayHours[displayHours.length - 1] ? '1px solid #dee2e6' : 'none',
                  cursor: 'pointer',
                  position: 'relative',
                  display: 'flex',
                  flexDirection: 'column',
                  justifyContent: 'center',
                  alignItems: 'center',
                  background: hasEvents ? '#dc3545' : 'white',
                  transition: 'all 0.3s ease',
                  minWidth: '50px'
                }}
                onMouseEnter={(e) => {
                  if (!hasEvents) {
                    e.target.style.background = '#f8f9fa';
                    e.target.style.transform = 'scale(1.02)';
                  } else {
                    e.target.style.background = '#c82333';
                    e.target.style.transform = 'scale(1.02)';
                  }
                }}
                onMouseLeave={(e) => {
                  e.target.style.background = hasEvents ? '#dc3545' : 'white';
                  e.target.style.transform = 'scale(1)';
                }}
                title={hasEvents ? 
                  `${hourEvents.length} event(s) at ${formatHour(hour)}` : 
                  `Available at ${formatHour(hour)} - Click to add event`
                }
              >
                {/* Tick mark */}
                <div style={{
                  position: 'absolute',
                  top: '-10px',
                  width: '2px',
                  height: '20px',
                  background: '#666',
                  left: '50%',
                  transform: 'translateX(-50%)'
                }}></div>
                
                {/* Event indicator */}
                {hasEvents && (
                  <div style={{
                    background: 'white',
                    color: '#dc3545',
                    borderRadius: '50%',
                    width: '24px',
                    height: '24px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    fontSize: '12px',
                    fontWeight: 'bold',
                    border: '2px solid white'
                  }}>
                    {hourEvents.length}
                  </div>
                )}
              </div>
            );
          })}
        </div>

        {/* Legend */}
        <div style={{
          display: 'flex',
          justifyContent: 'center',
          gap: '30px',
          marginTop: '20px',
          fontSize: '14px',
          color: 'white'
        }}>
          <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
            <div style={{
              width: '16px',
              height: '16px',
              borderRadius: '50%',
              background: 'white',
              border: '2px solid #4caf50',
              boxShadow: '0 2px 4px rgba(0,0,0,0.2)'
            }}></div>
            Available
          </div>
          <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
            <div style={{
              width: '16px',
              height: '16px',
              borderRadius: '50%',
              background: '#ff6b6b',
              border: '2px solid #e63946',
              boxShadow: '0 2px 4px rgba(0,0,0,0.2)'
            }}></div>
            Booked
          </div>
        </div>
      </div>

      {/* Events Summary */}
      {events.length > 0 && (
        <div style={{ 
          marginTop: '30px',
          background: 'rgba(255, 255, 255, 0.95)',
          borderRadius: '12px',
          padding: '20px',
          backdropFilter: 'blur(10px)',
          boxShadow: '0 4px 16px rgba(0,0,0,0.1)'
        }}>
          <h4 style={{ marginBottom: '15px', color: '#333', fontSize: '20px' }}>Today's Schedule</h4>
          <div style={{ 
            display: 'grid', 
            gap: '12px',
            maxHeight: '200px',
            overflowY: 'auto'
          }}>
            {events
              .sort((a, b) => a.time.localeCompare(b.time))
              .map((event, index) => {
                const eventHour = parseInt(event.time.split(':')[0]);
                const colors = getSlotColors(eventHour, true);
                return (
                  <div
                    key={event.id}
                    style={{
                      background: `linear-gradient(135deg, ${colors.bg}, rgba(255,255,255,0.9))`,
                      padding: '16px 20px',
                      borderRadius: '8px',
                      border: `2px solid ${colors.border}`,
                      display: 'flex',
                      justifyContent: 'space-between',
                      alignItems: 'center',
                      cursor: 'pointer',
                      transition: 'all 0.3s ease',
                      boxShadow: '0 2px 8px rgba(0,0,0,0.1)'
                    }}
                    onClick={() => window.location.href = `/event/${event.id}`}
                    onMouseEnter={(e) => {
                      e.target.style.transform = 'translateY(-2px)';
                      e.target.style.boxShadow = '0 4px 16px rgba(0,0,0,0.2)';
                    }}
                    onMouseLeave={(e) => {
                      e.target.style.transform = 'translateY(0)';
                      e.target.style.boxShadow = '0 2px 8px rgba(0,0,0,0.1)';
                    }}
                  >
                    <div>
                      <div style={{ fontWeight: 'bold', color: colors.border, marginBottom: '4px', fontSize: '16px' }}>
                        {event.title}
                      </div>
                      <div style={{ fontSize: '14px', color: '#666' }}>
                        {event.time} â€¢ {event.duration} min
                      </div>
                    </div>
                    <div style={{
                      background: colors.border,
                      color: 'white',
                      padding: '8px 12px',
                      borderRadius: '6px',
                      fontSize: '12px',
                      fontWeight: 'bold',
                      boxShadow: '0 2px 4px rgba(0,0,0,0.2)'
                    }}>
                      View
                    </div>
                  </div>
                );
              })}
          </div>
        </div>
      )}
    </div>
  );
}

export default TimelineSlots;
